import { useState } from 'react';

const Counter = () => {
  const [count, setCount] = useState(0)
  return (
    <div>
	<h1>{count}</h1>
	<button onClick={() => setCount(count + 1)}>Increment by 1</button>
    </div>
  )
}

export default Counter
